function getLastday(year, month) {
	month = ToNumber(month);
	var lastday = 31;
	if (month == 2) {
		lastday = 28;
		if (year % 4 == 0) {
		    lastday = 29;
		}
	} else if (month == 4 || month == 6 || month == 9 || month == 11) {
		lastday = 30;
	}
    return lastday;
}

function getWeekday(year, month, day) {
	var _day = ToNumber(day);
	if (_day < 10) {
		day = '0' + _day;
	}

	if (ToNumber(month) < 10) {
		month = '0' + ToNumber(month);
	}

	while (true) {
		var nday = year + '' + month + '' + day;
		var findRow = ds_list_holiday.FindRow('HOLIDAY_YMD', nday);
		var domain = ds_list_holiday.GetColumn(findRow, 'DOMAIN');
		if (findRow > -1 && domain == 'KR') {
			_day = ToNumber(_day) -1;
			if (_day < 10) {
				_day = '0' + _day;
			}
			day = _day;

			nday = year + '' + month + '' + day;
		} else {
			break;
		}
	}
	trace('weekday : ' + year + '' + month + '' + day);
	return year + '' + month + '' + day;
}

function setMdate() {
	//cal_rsltym.Value = gfn_getCurrDate();
	//cal_rsltym.SetFocus();

	var today = gfn_getCurrDate();
	var year = ToNumber(substr(today, 0, 4));
	var beforeYear = year;
	var month = ToNumber(substr(today, 4, 2));
	var beforeMonth = month -1;
	if (beforeMonth == 0) {
		beforeMonth = 12;
		beforeYear = beforeYear -1;
	}

	var nextYear = year;
	var nextMonth = month + 1;
	if (nextMonth > 12) {
		nextMonth = nextMonth - 12;
		nextYear = year + 1;
	}

	var monthAfter2th = month + 2;
	if (nextMonth > 12) {
		monthAfter2th = monthAfter2th - 12;
		if (nextYear == year) {
			nextYear = year + 1;
		}
	}

	var monthAfter3th = month + 3;
	if (nextMonth > 12) {
		monthAfter2th = monthAfter2th - 12;
		if (nextYear == year) {
			nextYear = year + 1;
		}
	}

	var day = ToNumber(substr(today, 6, 2));
	day = day -1;
	if (day == 0) {
	    month = month -1;
	    beforeMonth = beforeMonth -1;
	    nextMonth = nextMonth -1;
	    monthAfter2th = monthAfter2th -1;
	    monthAfter3th = monthAfter3th -1;

	    if (month == 0) {
	        month = 12;
	        year = year -1;
	    }

	    day = getLastday(year, month);
	}

	if (day < 10) {
		day = '0' + day;
	}

	if (month < 10) {
		month = '0' + month;
	}

	if (beforeMonth < 10) {
		beforeMonth = '0' + beforeMonth;
	}

	if (nextMonth < 10) {
		nextMonth = '0' + nextMonth;
	}

	if (monthAfter2th < 10) {
		monthAfter2th = '0' + monthAfter2th;
	}

	if (monthAfter3th < 10) {
		monthAfter3th = '0' + monthAfter3th;
	}

	ds_mdate.AddRow();
	var beforeLastday = getLastday(beforeYear, beforeMonth);
	trace('beforeLastday : ' + beforeLastday);
	ds_mdate.SetColumn(0, 'CODE', getWeekday(beforeYear, beforeMonth, beforeLastday));
	ds_mdate.SetColumn(0, 'CODE_NAME', beforeYear + '년' + beforeMonth + '월');

	ds_mdate.AddRow();
	var thisday = getWeekday(year, month, day);
	trace('thisday : ' + thisday);
	ds_mdate.SetColumn(1, 'CODE', thisday);
	ds_mdate.SetColumn(1, 'CODE_NAME', year + '년' + month + '월');

	ds_mdate.AddRow();
	ds_mdate.SetColumn(2, 'CODE', nextYear + '' + nextMonth + '' + '01');
	ds_mdate.SetColumn(2, 'CODE_NAME', nextYear + '년' + nextMonth + '월');

	ds_mdate.AddRow();
	ds_mdate.SetColumn(3, 'CODE', nextYear + '' + monthAfter2th + '' + '01');
	ds_mdate.SetColumn(3, 'CODE_NAME', nextYear + '년' + monthAfter2th + '월');

	cal_rsltym.Value = thisday;
	trace('mdate : ' + cal_rsltym.Value);
	cal_rsltym.SetFocus();
}

