function fn_query() {

	gfn_showMsg("");

	// 년월 필드 필수체크
	if(gfn_isNull(cal_rsltym, true, st_rsltym.value))
		return;

	// RAW데이터생성배치실행중체크
	tit_clearActionInfo();
	tit_addSearchActionInfo("ps17:PS1701001A_CS2");
	tit_callService(
		""
		, ""
		, "ds_cond=ds_cond"
		, "ds_list_batch_on_off=ds_list_batch_on_off"
		, ""
		, ""
		, ""
		, ""
		, true);
	if (ds_list_batch_on_off.RowCount() > 0) {
		var on_off = ds_list_batch_on_off.GetColumn(0, 'ON_OFF');
		if (on_off == 'Y') {
			var args = 'fa_msg=' + quote('RAW데이터 생성 배치가 실행중입니다.\n\r잠시후 다시 조회해 주시기 바랍니다.') + ' fa_msgCode=알림';
			return Dialog("WB01::CommMsgForm.xml", args, -1, -1, "titlebar=false statusBar=false");
			return;
		}
	}

	fn_switchGrid();

	tit_clearActionInfo();

	var zzactss = ds_cond.GetColumn(0, 'ZZACTSS');
	var zzlifnr = ds_cond.GetColumn(0, 'ZZLIFNR');
	var zzpmnum = ds_cond.GetColumn(0, 'ZZPMNUM');

	var outData = '';
	var callback = 'fn_afterQuery';
	if (Length(zzpmnum) > 0) {
		// tit_addSearchActionInfo("ps17:PS1701001A_S4");
        // outData = 'ds_list_zzpmnum=ds_list_zzpmnum';
		// callback = 'fn_afterQuery_zzpmnum';
        ds_list_zzpmnum.ClearData();
        callServiceN("query"
                   , "ps17/groupByTemno"
                   , "ds_cond=ds_cond"
                   , "ds_list_zzpmnum=ds_list_tmp ds_error=ds_error"
                   , ""
                   , "fn_afterQuery_zzpmnum"
                  );
        return;
	} else if (Length(zzlifnr) > 0) {
		// tit_addSearchActionInfo("ps17:PS1701001A_S3");
		// outData = 'ds_list_lifnr_with_zzpmnum=ds_list_lifnr_with_zzpmnum';
		// callback = 'fn_afterQuery_lifnr_with_zzpmnum';
        ds_list_lifnr_with_zzpmnum.ClearData();
        callServiceN("query"
                   , "ps17/groupByLifnr"
                   , "ds_cond=ds_cond"
                   , "ds_list_lifnr_with_zzpmnum=ds_list_tmp ds_error=ds_error"
                   , ""
                   , "fn_afterQuery_lifnr_with_zzpmnum"
                  );
        return;
	} else if (Length(zzactss) > 0) {
		// tit_addSearchActionInfo("ps17:PS1701001A_S2");
		// outData = 'ds_list_lifnr=ds_list_lifnr';
		// callback = 'fn_afterQuery_lifnr';
        ds_list_lifnr.ClearData();
        callServiceN("query"
                   , "ps17/groupByActss"
                   , "ds_cond=ds_cond"
                   , "ds_list_lifnr=ds_list_tmp ds_error=ds_error"
                   , ""
                   , "fn_afterQuery_lifnr"
                  );
        return;
	} else {
		Trace("Group by Team");
		// tit_addSearchActionInfo("ps17:PS1701001A_S1");
		// outData = 'ds_list_summary=ds_list_summary';
		// callback = 'fn_afterQuery_summary';
        ds_list_summary.ClearData();
        callServiceN("query"
                   , "ps17/groupByTeam"
                   , "ds_cond=ds_cond"
                   , "ds_list_summary=ds_list_tmp ds_error=ds_error"
                   , ""
                   , "fn_afterQuery_summary"
                  );
        return;
	}

	tit_callService(
          ""
        , ""
        , "ds_cond=ds_cond"
        , outData
        , ""
        , callback
        , true);
}

function fn_afterQuery_zzpmnum(errCode, errMsg) {
	fn_createWait("", this);

    // trace(ds_list_zzpmnum.SaveXml());
    trace('tot_mh count : ' + ds_list_zzpmnum.RowCount());

	ds_list_zzpmnum.fireevent = false;

	var offset = 10;
	//var today = gfn_getCurrDate();
	var today = ds_cond.GetColumn(0, 'MDATE');
	var curMonth = ToNumber(substr(today, 4, 2));
	for(var i = offset; i <= offset + 91; i++) {
		var nday = AddDate(today, i - offset);
		var nmonth = substr(nday, 4, 2);
		if (curMonth + 2 < ToNumber(nmonth)) {
			// 컬럼 삭제
			grd_zzpmnum.SetColProp(i, 'Width', 0);
		} else {
			var findRow = ds_list_holiday.FindRow('HOLIDAY_YMD', nday);
			var domain = ds_list_holiday.GetColumn(findRow, 'DOMAIN');
			var desc = ds_list_holiday.GetColumn(findRow, 'DESC');

			if (findRow > -1 && domain == 'KR' && desc != 'SAT') {
				// cell에 휴일 표시
				grd_zzpmnum.SetCellProp('head', i, 'color', 'red');
				grd_zzpmnum.SetCellProp('body', i, 'color', 'red');
				grd_zzpmnum.SetCellProp('body', i, 'display', 'text');
				grd_zzpmnum.SetCellProp('body', i, 'mask', '');
				grd_zzpmnum.SetCellProp('body', i, 'align', 'center');

				for(var j = 0; j < ds_list_zzpmnum.RowCount(); j++) {
					ds_list_zzpmnum.SetColumn(j, 'N' + (i - offset), '휴일');
				}
			} else {
				grd_zzpmnum.SetCellProp('head', i, 'color', 'black');
				grd_zzpmnum.SetCellProp('body', i, 'color', 'black');
				grd_zzpmnum.SetCellProp('body', i, 'display', 'number');
				//grd_zzpmnum.SetCellProp('body', i, 'mask', '');
				grd_zzpmnum.SetCellProp('body', i, 'align', 'right');
			}
			// 헤더 날짜 표시
			nday = nmonth + "/" + substr(nday, 6, 2);
			grd_zzpmnum.SetCellProp('head', i, 'text', nday);
		}
	}

	//Trace(ds_list_holiday.saveXML());
	fn_destroyWait("", this);

	ds_list_zzpmnum.fireevent = true;

	gfn_showSearchMsg(grd_zzpmnum, errCode, errMsg);
}

function fn_afterQuery_lifnr(errCode, errMsg)
{
	var curMonth = ToNumber(substr(ds_cond.GetColumn(0, 'MDATE'), 4, 2));
	var monthAfter1th = curMonth + 1;
	if (monthAfter1th > 12) {
		monthAfter1th = monthAfter1th - 12;
	}
	var monthAfter2th = curMonth + 2;
	if (monthAfter2th > 12) {
		monthAfter2th = monthAfter2th - 12;
	}

	ds_list_lifnr.fireevent = false;

	grd_lifnr.SetCellProp('head', 2, 'text', curMonth + '월');
	grd_lifnr.SetCellProp('head', 3, 'text', '' + monthAfter1th + '월');
	grd_lifnr.SetCellProp('head', 4, 'text', '' + monthAfter2th + '월');

	ds_list_lifnr.fireevent = true;

	gfn_showSearchMsg(grd_lifnr, errCode, errMsg);
}

