function fn_afterQuery_summary(errCode, errMsg)
{
	var curMonth = ToNumber(substr(ds_cond.GetColumn(0, 'MDATE'), 4, 2));
	var monthAfter1th = curMonth + 1;
	if (monthAfter1th > 12) {
		monthAfter1th = monthAfter1th - 12;
	}
	var monthAfter2th = curMonth + 2;
	if (monthAfter2th > 12) {
		monthAfter2th = monthAfter2th - 12;
	}

	ds_list_summary.fireevent = false;

	grd_summary.SetCellProp('head', 1, 'text', curMonth + '월현재');
	grd_summary.SetCellProp('head', 2, 'text', '' + curMonth + '월');
	grd_summary.SetCellProp('head', 3, 'text', '' + monthAfter1th + '월');
	grd_summary.SetCellProp('head', 4, 'text', '' + monthAfter2th + '월');

	ds_list_summary.fireevent = true;

	// 보유인원, 지원, 피지원 수정


	// 현대EL 
	var nFirstRow = ds_list_summary.SearchRow("GRUP2 == '0'");

	var j1Sum = ds_list_summary.Sum("JINWON");
	var p1Sum = ds_list_summary.Sum("PJIWON");
	var B1inwon = ds_list_summary.GetColumn(nFirstRow, "BINWON");

	ds_list_summary.SetColumn(nFirstRow, "JINWON", j1Sum);
	ds_list_summary.SetColumn(nFirstRow, "PJIWON", p1Sum);
	ds_list_summary.SetColumn(nFirstRow, "HINWON", toNumber(B1inwon)-toNumber(j1Sum)+toNumber(p1Sum));

	// 나머지 팀별 SUM
	for(var i=1; i<=6; i++)
	{
		var nRow = ds_list_summary.SearchRow("GRUP2 == '"+i+"' && GUBUN == '1'");

		var jSum = ds_list_summary.CaseSum("GRUP2 == '"+i+"' && GUBUN == '0'", "JINWON");
		var pSum = ds_list_summary.CaseSum("GRUP2 == '"+i+"' && GUBUN == '0'", "PJIWON");
		var Binwon = ds_list_summary.GetColumn(nRow, "BINWON");

		ds_list_summary.SetColumn(nRow, "JINWON", jSum);
		ds_list_summary.SetColumn(nRow, "PJIWON", pSum);
		ds_list_summary.SetColumn(nRow, "HINWON", toNumber(Binwon)-toNumber(jSum)+toNumber(pSum));

	}

	for(var i=0;i<ds_list_summary.GetRowCount();i++)
	{
		var Hinwon = toNumber(ds_list_summary.GetColumn(i,"BINWON")) - toNumber(ds_list_summary.GetColumn(i,"JINWON")) + toNumber(ds_list_summary.GetColumn(i,"PJIWON"));
		ds_list_summary.SetColumn(i, "HINWON", Hinwon);
	}



	gfn_showSearchMsg(grd_summary, errCode, errMsg);
}

