/********************************************************************************
* 기      능   : 사무소콤보 변경
********************************************************************************/
function cb_zzactss_OnChanged(obj,strCode,strText,nOldIndex,nNewIndex)
{
    if(ds_cond.GetColumn(0, "ZZACTSS") == '')
    {
		ds_zzlifnr.UnFilter();
    }
    else
    {
		var arr = ds_cond.GetColumn(0, "ZZACTSS");
		ds_zzlifnr.Filter("CODE == " + quote("") + " || ZZACTSS == " +quote(arr));
    }

	ds_cond.SetColumn(0, "ZZACTSS", strCode);
	cb_zzlifnr.value = '';
	cb_zzpmnum.value = "";

	fn_query();
}

function cb_zzlifnr_OnChanged(obj,strCode,strText,nOldIndex,nNewIndex) {
	trace('ZZLIFNR : ' + strCode);
	ds_cond.SetColumn(0, "ZZLIFNR", strCode);

	tit_clearActionInfo();
	tit_addSearchActionInfo("ps17:PS1701001A_CS0");

	tit_callService(
		""
		, ""
		, "ds_cond=ds_cond"
		, "ds_zzpmnum_cd=ds_zzpmnum_cd"
		, ""
		, ""	//callback
		, ""
		, ""
		, true);

	gfn_insertEmptyRow(ds_zzpmnum_cd, G_CODE_ALL);
	cb_zzpmnum.value = '';

	fn_query();
}

function cb_zzpmnum_OnChanged(obj,strCode,strText,nOldIndex,nNewIndex) {
	ds_cond.SetColumn(0, "ZZPMNUM", strCode);
	fn_query();
}

function chk_temno_Only_clicked(obj,strCode,strText,nOldIndex,nNewIndex) {
	fn_query();
}

function fn_switchGrid() {
	var zzactss = ds_cond.GetColumn(0, 'ZZACTSS');
	var zzlifnr = ds_cond.GetColumn(0, 'ZZLIFNR');
	var zzpmnum = ds_cond.GetColumn(0, 'ZZPMNUM');

	if (Length(zzpmnum) > 0) {
		trace('소장 화면');
		grd_zzpmnum.Visible = true;
		grd_summary.Visible = false;
		grd_lifnr.Visible = false;
		grd_lifnr_with_zzpmnum.Visible = false;
		chk_temno_only.Visible = true;
	} else if (Length(zzlifnr) > 0) {
		trace('소장별 화면');
		grd_zzpmnum.Visible = false;
		grd_summary.Visible = false;
		grd_lifnr.Visible = false;
		grd_lifnr_with_zzpmnum.Visible = true;
		chk_temno_only.Visible = false;
		chk_temno_only.value = '0';
	} else if (Length(zzactss) > 0) {
		trace('협력사별 화면');
		grd_zzpmnum.Visible = false;
		grd_summary.Visible = false;
		grd_lifnr_with_zzpmnum.Visible = false;
		grd_lifnr.Visible = true;
		chk_temno_only.Visible = false;
		chk_temno_only.value = '0';
	} else {
		trace('설치로드 화면');
		grd_summary.Visible = true;
		grd_lifnr.Visible = false;
		grd_lifnr_with_zzpmnum.Visible = false;
		grd_zzpmnum.Visible = false;
		chk_temno_only.Visible = false;
		chk_temno_only.value = '0';
	}
}

/********************************************************************************
* 기      능   : Grid 포커스
********************************************************************************/
function fn_SetFocusGrid(pObjGrd, pRowNum, pColNum)
{
	var ObjDataset =  object(pObjGrd.BindDataset);

	pObjGrd.SetFocus();
	pObjGrd.SetCellPos(pColNum);

	ObjDataset.Fireevent 	= false;
	ObjDataset.row 			= pRowNum;
	ObjDataset.Fireevent 	= true;
}

