function grd_summary_OnCellDblClick(obj,nRow,nCell,nX,nY,nPivotIndex) {
	var zzactss = ds_list_summary.GetColumn(nRow, 'ACTSS');
	if (nCell == 1 && ds_list_summary.GetColumn(nRow, 'GUBUN') == '0') {
		trace('zzactss : ' + zzactss);
		if (Length(zzactss) > 0) {
			cb_zzactss_OnChanged(obj,zzactss, '', 0, 0);
		}
	} else if (nCell == 5) {
	    var MDATE = ds_cond.GetColumn(0, 'MDATE');
		var args = '_P_ZZACTSS=' + quote(zzactss);
		args += ' _P_INP_DT=' + quote(MDATE);
		if (Length(zzactss) == 0) {
		    var grup = ds_list_summary.GetColumn(nRow, 'ACTSS_NM');
		    args += ' _P_GRUP=' + quote(grup);
		}
		gfn_openPopup("PS1701001C", true, args);
	} else if (nCell >= 6 && nCell <= 7) {
		var args = '_P_ZZACTSS=' + quote(zzactss);
		if (nCell == 6) {
			args += ' _P_GBN=1';
		} else {
			args += ' _P_GBN=0';
		}
		if (Length(zzactss) == 0) {
		    var grup = ds_list_summary.GetColumn(nRow, 'ACTSS_NM');
		    var grup2 = ds_list_summary.GetColumn(nRow, 'GRUP2');
		    var gubun = ds_list_summary.GetColumn(nRow, 'GUBUN');
		    Trace(grup2);
		    Trace(gubun);

		    args += ' _P_GRUP=' + quote(grup) +' _P_GRUP2='+ quote(grup2) + ' _P_GUBUN='+ quote(gubun);
		}
		var mdate = ds_cond.GetColumn(0, 'MDATE');
		args += ' _P_INP_DT=' + quote(mdate);
		gfn_openPopup("PS1701001D", true, args);
	} else if (nCell == 4) {
		var B0 = ds_list_summary.GetColumn(nRow, 'B0');
		trace('B0 : ' + B0);
		if (Length(B0)) {
			var args = 'fa_msg=' + quote(B0) + ' fa_msgCode=비고';
			return Dialog("WB01::CommMsgForm.xml", args, -1, -1, "titlebar=false statusBar=false");
		}
	} else if (nCell == 12) {
		var B1 = ds_list_summary.GetColumn(nRow, 'B1');
		trace('B1 : ' + B1);
		if (Length(B1)) {
			var args = 'fa_msg=' + quote(B1) + ' fa_msgCode=비고';
			return Dialog("WB01::CommMsgForm.xml", args, -1, -1, "titlebar=false statusBar=false");
		}
	} else if (nCell == 17) {
		var B2 = ds_list_summary.GetColumn(nRow, 'B2');
		trace('B2 : ' + B2);
		if (Length(B2)) {
			var args = 'fa_msg=' + quote(B2) + ' fa_msgCode=비고';
			return Dialog("WB01::CommMsgForm.xml", args, -1, -1, "titlebar=false statusBar=false");
		}
	} else if (nCell == 22) {
		var B3 = ds_list_summary.GetColumn(nRow, 'B3');
		trace('B3 : ' + B3);
		if (Length(B3)) {
			var args = 'fa_msg=' + quote(B3) + ' fa_msgCode=비고';
			return Dialog("WB01::CommMsgForm.xml", args, -1, -1, "titlebar=false statusBar=false");
		}
	}
}

