function grd_lifnr_with_zzpmnum_OnCellDblClick(obj,nRow,nCell,nX,nY,nPivotIndex) {
    var mdate = ds_cond.GetColumn(0, 'MDATE');
	var zzactss = ds_list_lifnr_with_zzpmnum.GetColumn(nRow, 'ACTSS');
	var zzlifnr = ds_list_lifnr_with_zzpmnum.GetColumn(nRow, 'LIFNR');
	var zzpmnum = ds_list_lifnr_with_zzpmnum.GetColumn(nRow, 'TEMNO');
	var namet = ds_list_lifnr_with_zzpmnum.GetColumn(nRow, 'NAMET');

	if (nCell >= 2 && nCell <= 4) {
		var args = '_P_INP_DT=' + quote(mdate);
		if (nCell >= 2) {
			args += ' _P_ZZACTSS=' + quote(zzactss);
		}
		if (nCell >= 3) {
			args += ' _P_ZZLIFNR=' + quote(zzlifnr);
		}
		if (nCell >= 4) {
			args += ' _P_ZZPMNUM=' + quote(zzpmnum);
			args += ' _P_NAMET=' + quote(namet);
		}

		gfn_openPopup("PS1701001E", true, args);
	}
}

function fn_grd_zzpmnum_OnCellDblClick(obj,nRow,nCell,nX,nY,nPivotIndex) {
	var pspid = ds_list_zzpmnum.GetColumn(nRow, 'PSPID');
	var posid = ds_list_zzpmnum.GetColumn(nRow, 'POSID');
	if (nCell == 6 && Length(pspid) > 0) {
		var args = 'F_PSPID=' + quote(pspid);
		if (Length(posid) > 0) {
			args += ' _P_POSID=' + quote(posid);
		}
		gfn_openWin("PS0209001A", args);
	} else if (nCell == 3) {
	    var MDATE = ds_cond.GetColumn(0, 'MDATE');
	    var TEMNO = ds_list_zzpmnum.GetColumn(nRow, 'TEMNO');
		var args = '_P_ZZACTSS=' + quote(zzactss);
		args += ' _P_INP_DT=' + quote(MDATE);
		if (Length(TEMNO) > 0) {
			args += ' _P_ZZPMNUM=' + quote(TEMNO);
		}
		if (Length(zzactss) == 0) {
		    var grup = ds_list_summary.GetColumn(nRow, 'ACTSS_NM');
		    args += ' _P_GRUP=' + quote(grup);
		}
		gfn_openPopup("PS1701001C", true, args);
	} else if (nCell == 5) {
		var arg = "posid="+quote(ds_list_zzpmnum.GetColumn(nRow,"PSPID"));
		gfn_openWin("PS0101001A",arg);
	} else if (nCell >= 9) {
		var bigo = ds_list_zzpmnum.GetColumn(nRow, 'bigo');
		trace('bigo : ' + bigo);
		var category = ds_list_zzpmnum.GetColumn(nRow, 'category');
		if (category != 'Load') {
			var args = 'fa_msg=' + quote(bigo) + ' fa_msgCode=비고';
			return Dialog("WB01::CommMsgForm.xml", args, -1, -1, "titlebar=false statusBar=false");
		}
	}
}

function getLoad(ds_name, nMonth) {
	if (ds_name == 'ds_list_lifnr_with_zzpmnum') {
		var MH = ds_list_lifnr_with_zzpmnum.Sum('MH' + nMonth);
		var CP = ds_list_lifnr_with_zzpmnum.Sum('CP' + nMonth);
		return MH / CP * 100;
	} else if (ds_name == 'ds_list_lifnr') {
		var MH = ds_list_lifnr.Sum('MH' + nMonth);
		var CP = ds_list_lifnr.Sum('CP' + nMonth);
		return MH / CP * 100;
	}
	return 0;
}

function getCp(ds_name, nMonth) {
	var load = getLoad(ds_name, nMonth);
	if (ds_name == 'ds_list_lifnr_with_zzpmnum') {
		var cp = ds_list_lifnr_with_zzpmnum.Sum('CP' + nMonth);
		return cp - (cp * 100 / load);
	} else if (ds_name == 'ds_list_lifnr') {
		var cp = ds_list_lifnr.Sum('CP' + nMonth);
		return cp - (cp * 100 / load);
	}
	return 0;
}

function getMc(ds_name, nMonth) {
	var cp = getCp(ds_name, nMonth);
	return Round(cp / 169.99) + '명';
}


